প্রথমে,🙂আমাকে🙂কালচারে বেড়ে ওঠা ক্যান্সারের কোষগুলির🙂বৈশিষ্ট্যগুলি🙂বুঝতে🙂হবে।🙂ক্যান্সারের কোষগুলি সাধারণত🙂অপরিসীম🙂সংখ্যায়🙂বিভাজিত🙂হয়ে🙂যায়,🙂এবং🙂এগুলি🙂সংস্পর্শজনিত🙂বাধা🙂পেলে🙂বিভাজন🙂করতে🙂বন্দ🙂করেনা। 

এরপর,🙂আমি🙂বিবেচনা🙂করব🙂যে🙂ক্যান্সারের কোষগুলির জন্য🙂বৃদ্ধির জন্য🙂কোনও পৃষ্ঠের প্রয়োজন নেই,🙂এবং🙂এগুলি🙂একই কোষ ঘনত্বে🙂বিস্তারলাভ🙂করতে🙂থাকে। 

অতএব,🙂সঠিক🙂উত্তরটি🙂হল🙂b)🙂সংস্পর্শজনিত🙂বাধা🙂পেলে🙂বিভাজন🙂করা🙂বন্ধ🙂করে🙂না।🙂{'sol': 'b'}

প্রথমে,🙂আমাকে🙂বিষয়টি🙂বুঝতে🙂হবে।🙂প্রাচ্যের ধর্মগুলি এবং খ্রিস্টধর্ম উভয়েই সন্ন্যাসী ও সন্ন্যাসিনীদের জন্য কিছু নৈতিক ব্যবস্থা রয়েছে, যা ব্রহ্মচর্য, কুমারীত্ব এবং দারিদ্র্যকে সমর্থন করে।

এরপর,🙂এই নৈতিক ব্যবস্থাগুলির মধ্যে কৃচ্ছ্রসাধন একটি গুরুত্বপূর্ণ অংশ।🙂কৃচ্ছ্রসাধন মানে হলো জীবনযাত্রায় কঠোরতা এবং ভোগবিলাস থেকে বিরত থাকা, যা সন্ন্যাসীদের জন্য প্রযোজ্য।

অতএব,🙂সঠিক উত্তর হবে কৃচ্ছ্রসাধন।🙂{'sol': 'b'}

প্রথমে,🙂'মার্জিন অফ অ্যাপ্রিশিয়েশন' মতবাদটি ইউরোপীয় মানবাধিকার আদালতের দ্বারা প্রবর্তিত একটি ধারণা, যা রাষ্ট্রগুলিকে তাদের মানবাধিকার বাধ্যবাধকতা পূরণের ক্ষেত্রে কিছু পরিমাণের স্বাধীনতা দেয়।🙂এটি মূলত আদালতের সিদ্ধান্তে রাষ্ট্রগুলির স্থানীয় পরিস্থিতি এবং সংস্কৃতির প্রতি সম্মান প্রদর্শনের জন্য ব্যবহৃত হয়।

এরপর,🙂এই মতবাদটি প্রথম কোন মামলায় নির্ধারিত হয়েছিল তা খুঁজে বের করতে হবে।🙂এটি সাধারণত 'হ্যান্ডিসাইড বনাম যুক্তরাজ্য' মামলায় (1976) উল্লেখ করা হয়, যেখানে আদালত এই ধারণাটি প্রতিষ্ঠা করে যে, রাষ্ট্রগুলিকে তাদের মানবাধিকার বাধ্যবাধকতা পূরণের ক্ষেত্রে কিছু পরিমাণের স্বাধীনতা দেওয়া উচিত।

অতএব,🙂সঠিক উত্তর হল 'হ্যান্ডিসাইড বনাম যুক্তরাজ্য (1976)'।🙂{'sol': 'd'}

প্রথমে,🙂আমাকে🙂বিষয়টি🙂বুঝতে🙂হবে।🙂তীব্র🙂মাত্রাতিরিক্ত🙂মদ্যপান🙂সাধারণত🙂ছুটির🙂মৌসুমে🙂ঘটিত🙂হয়,🙂যেখানে🙂মানুষরা🙂অতিরিক্ত🙂মদ্যপান🙂করে। 

এরপর,🙂"হলিডে হার্ট সিন্ড্রোম"🙂শব্দটি🙂এমন🙂একটি🙂অবস্থাকে🙂বর্ণনা🙂করে🙂যা🙂ছুটির🙂মৌসুমে🙂অতিরিক্ত🙂মদ্যপান🙂এর কারণে🙂হৃদরোগের🙂ঝুঁকি🙂বাড়িয়ে🙂দেয়। 

অতএব,🙂সঠিক🙂উত্তর🙂হল🙂'd) হলিডে হার্ট সিন্ড্রোম'।🙂{'sol':🙂'd'}
